import React from 'react';
import Container from '../components/container';
import { Button } from '../components/uiComponent';

const Login = () => {
  return (
    <Container >
      <Container>
        <input type="text" placeholder="아이디" />
        <input type="text" placeholder="패스워드" />
        <Button>로그인</Button>
      </Container>
    </Container>
  );
};

export default Login;
